import React from "react";
import { FaGlobeAsia } from "react-icons/fa";

function Home() {
  return (
    <div className="p-12 text-center relative">
      <img src="/Grad 6.JPG" alt="Mahek Bhagchandani" className="mx-auto w-48 h-48 object-cover rounded-full mb-6 shadow-lg border-4 border-blue-800" />
      <h2 className="text-4xl font-bold mb-6 text-blue-400">Leading with Purpose</h2>
      <p className="mb-8 text-lg leading-relaxed max-w-3xl mx-auto">
        “Leading with Purpose” isn’t just a phrase. It’s how I show up. As a South Asian woman navigating high-performance spaces, I’ve learned that leadership isn’t always loud, but it’s always felt. My purpose stems from moments when I wasn’t included, and I chose to create spaces where others never feel the same.
      </p>
      <h3 className="text-2xl font-semibold mb-2 text-blue-300">About Me</h3>
      <p className="text-lg leading-relaxed max-w-4xl mx-auto">
        I'm Mahek Bhagchandani, an Indian woman, lifelong learner, and passionate builder of inclusive communities. I’m pursuing a Master’s in Industrial and Organizational Psychology at the University of New Haven. My story since 2019 has been one of transition, trust, and transformation.
      </p>
      <FaGlobeAsia className="absolute top-8 left-8 text-blue-900 opacity-10 text-9xl rotate-45" />
    </div>
  );
}

export default Home;
